  - name: TEXT4000
    number: '4'
    value: The committee maintains a separate Levin account which was established
      solely for the receipt of Levin funds for Federal Election Activity according
      to 11 CFR 300.30.  The phrase Voter registration table in the purpose field
      on H6 and 30b is generic in nature and does not support any federal candidate
      or any other Federal Election Activity.  The individuals who maintain these
      tables are not employees of the committee and therefore not subject to 11 CFR
      300.33(c)(2).    The committee does not use any national party transfers to
      fund Federal Election Activity.  The party utilizes a strict accounting method
      to ensure that national party transfers are being used only for permissible
      administrative and overhead expenses.  This accounting method also guarantees
      that all Federal Election Activity is being funded by contributions raised under
      the limitations and prohibitions of the Federal Election Campaign Act
  - name: AMENDED CD
    number: '5'
    value: ' as amended.    The employees reported on H4 do not spend more than 25%
      of their time on federal election activity and therefore are not subject to
      11 CFR 300.33(c)(2).  The payments to individuals for office cleaning and computer
      consulting reported on H4 are not employees of the committee and therefore are
      not subject to 11 CFR 300.33(c)(2).    The petty cash disbursements account
      is used for cash expenditures which do not exceed $100.00 to any person or purchase
      transaction.  No disbursements are made for candidates.  Our Best Efforts policy
      for 2006 was disclosed on Form 99 filed on 02/16/06'
  - value: ' FEC-202621.  Please refer to this document for explanation of our efforts
      to obtain the occupation and name of employer for each contributor.'
